import {
  INVALIDATE, VALIDATE
} from '../constants/ActionTypes'

function _invalidate({ fieldID, error }) {
  return {
    type: INVALIDATE,
    fieldID,
    error
  }
}

function _validate(fieldID) {
  return {
    type: VALIDATE,
    fieldID
  }
}

export function validate({fieldID, value, validation, error}) {
  return dispatch => {
    if (!(validation(value))) {
      dispatch(_invalidate({ fieldID, error }))
      return false
    } else {
      dispatch(_validate(fieldID))
      return true
    }
  }
}

import React, { Component } from 'react'
import { createStore, compose } from 'redux'
import { Provider } from 'react-redux'
import { persistStore } from 'redux-persist'
import createFilter from 'redux-persist-transform-filter'
import localForage from 'localforage'
import PropTypes from 'prop-types'
import reducer from '../reducers'
import Splash from './Splash'

class AppProvider extends Component {
  constructor(props) {
    super(props)

    this.state = {
      rehydrated: false
    }
  }

  componentWillMount(){
    persistStore(this.props.store, {
      storage: localForage,
      whitelist: [
        'orderEntities',
        'orders',
        'productEntities',
        'products',
        'productIDsByProductName',
        'cashierEntities',
        'cashiers',
        'barcodeEntities',
        'barcodes',
        'barcodeIDsByProductID',
        'app',
        'session'
      ],
      transforms: [
        createFilter('orders', ['unprocessedItems', 'processedItems']),
        createFilter('products', ['items']),
        createFilter('cashiers', ['items', 'itemsByUsername', 'activeCashier']),
        createFilter('barcodes', ['items'])
      ]
    }, () => {
      this.setState({
        rehydrated: true
      })
    })
  }

  render() {
    if(!this.state.rehydrated){
      return <Splash/>
    }
    return (
      <Provider store={this.props.store}>
        { this.props.children }
      </Provider>
    )
  }
}

AppProvider.propTypes = {
  store: PropTypes.object.isRequired
}

AppProvider.defaultProps = {
  store: {}
}

export default AppProvider

