import OperationModes from '../constants/OperationModes'

export function orders(state = {
  isProcessing: false,
  lastUpdated: null,
  unprocessedItems: [],
  processedItems: [],
  error: null,
  mode: OperationModes.STOCKTAKE,
  pendingTransaction: null
}, action) {
  switch (action.type) {
    case 'ADD_ORDER':
      return {
        ...state,
        unprocessedItems: [
          ...state.unprocessedItems,
          action.id
        ]
      }
    case 'DELETE_ORDER':
      return {
        ...state,
        unprocessedItems: state.unprocessedItems.filter(value => {
          return value !== action.id
        })
      }
    case 'REQUEST_PROCESS_ORDERS':
      return {
        ...state,
        isProcessing: true
      }
    case 'RECEIVE_PROCESS_ORDERS':
      return {
        ...state,
        isProcessing: false,
        lastUpdated: action.receivedAt
      }
    case 'SUCCEED_PROCESS_ORDERS':
      return {
        ...state,
        processedItems: [...state.orders.unprocessedItems, ...state.orders.processedItems],
        unprocessedItems: filter(state.orders.unprocessedItems, id => {
          return state.orderEntities[id] &&
            state.orderEntities[id].TransType === state.orders.mode
          }).map(id => {
            return state.orderEntities.hasOwnProperty(id) && state.orderEntities[id]
          }
        )
      }
    case 'FAIL_PROCESS_ORDERS':
      return {
        ...state,
        error: action.error
      }
    case 'CHANGE_OPERATION_MODE':
      return {
        ...state,
        mode: action.mode
      }
    case 'CREATE_PENDING_TRANSACTION':
      return {
        ...state,
        pendingTransaction: action.transaction
      }
    case 'DISCARD_PENDING_TRANSACTION':
      return {
        ...state,
        pendingTransaction: null
      }
    case 'START_CHANGING_ORDER_QUANTITY':
      return {
        ...state,
        isChangingOrderQuantity: true
      }
    case 'CHANGE_ORDER_QUANTITY':
      return {
        ...state,
        isChangingOrderQuantity: false
      }
    default:
      return state
  }
}

export function orderEntities(state = {}, action) {
  switch (action.type) {
    case 'ADD_ORDER':
      return {
        ...state,
        [action.id]: action.order
      }
    case 'DELETE_ORDER':
      let newState = { ...state }

      delete newState[action.id]

      return newState
    case 'CHANGE_ORDER_QUANTITY':
      return {
        ...state,
        [action.id]: {
          ...state[action.id],
          Qty: action.quantity
        }
      }
    case 'RECEIVE_ORDERS':
      return keyBy(action.orders, '_id')
    default:
      return state
  }
}

